  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css">
  <style>
    .organizational-chart {
      display: flex;
      justify-content: flex-start;
      align-items: center;
      gap: 20px;
      overflow-x: auto; /* Scroll horizontal */
      padding: 20px;
      width: 100%;
      scroll-behavior: smooth; /* Animasi scroll */
      scrollbar-width: thin; /* Gaya scrollbar untuk browser modern */
    }

    .organizational-chart::-webkit-scrollbar {
      height: 8px;
    }

    .organizational-chart::-webkit-scrollbar-thumb {
      background-color: #cccccc;
      border-radius: 4px;
    }

    .org-item {
      background-color: #ffffff;
      padding: 20px;
      border-radius: 10px;
      text-align: center;
      font-weight: bold;
      box-shadow: 0 8px 16px rgba(0, 0, 0, 0.2);
      width: 220px;
      flex: 0 0 auto; /* Pastikan ukuran tetap */
      transition: transform 0.3s ease, box-shadow 0.3s ease;
      cursor: pointer; /* Tanda bisa diklik */
    }

    .org-item:hover {
      transform: translateY(-10px);
      box-shadow: 0 12px 20px rgba(0, 0, 0, 0.3);
    }

    .org-item img {
      border-radius: 10px;
      width: 100%;
      height: auto;
    }

    .org-item h3 {
      font-size: 1.2em;
      margin-top: 10px;
    }

    .org-item p {
      font-size: 0.9em;
      font-weight: normal;
    }

    /* Responsif untuk perangkat mobile */
    @media (max-width: 768px) {
      .organizational-chart {
        gap: 10px;
        padding: 10px;
      }

      .org-item {
        width: 180px;
        font-size: 0.9em;
      }

      .org-item h3 {
        font-size: 1em;
      }

      .org-item p {
        font-size: 0.8em;
      }
    }
  </style>
</head>
